data Query = Q Int Int | U Int Int


read' s = let [cmd, a, b] = words s
           in if cmd == "Q" then Q (read a) (read b)
              else U (read a) (read b)

subs as l r = drop l $ take (r+1) as

gcm as = foldl1 gcm' as
         where gcm' a b = a * b `div` gcd a b

m = 10 ^ 9 + 7

process (Q l r) as = do
  putStrLn $ show $ (`mod` m) $ gcm $ subs as l r
  return as
process (U i v) as = let as' = update i v as in return as'

update 0 v (a:as) = v*a:as
update n v (a:as) = a:update (n-1) v as

main = do
        as <- getLine >> getLine >>= return . map read . words
        n <- getLine >>= return. read
        loop as n
        where loop _ 0 = return ()
              loop as n = do q <- getLine >>= return . read'
                             as' <- process q as
                             loop as' (n-1)
